import logo from './logo.svg';
import './App.css';
import Diagnose from './Diagnose';

import {Route, Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Route exact path = "/" component={Diagnose} />
      </header>
    </div>
  );
}

export default App;
